import pandas as pd

def expand_statement_pattern(df):
	statement_pattern = "The {city_type} city in the {comparative} state in the US is {city_name}."
	expanded_statement_list = []

	df["population_city"] = pd.to_numeric(df["population_city"], errors="coerce")
	df["area"] = pd.to_numeric(df["area"], errors="coerce")

	for city_type in ['minor', 'major']:
		for comparative in ['smallest', 'largest']:
			if comparative == 'smallest':
				target_state = df.loc[df["area"].idxmin()]
			else:
				target_state = df.loc[df["area"].idxmax()]
			state_name = target_state["state_name"]

			city_population_threshold = 150000
			if city_type == 'major':
				cities = df[(df["state_name"] == state_name) & (df["population_city"] > city_population_threshold)]
			else:
				cities = df[(df["state_name"] == state_name) & (df["population_city"] <= city_population_threshold)]

			for _, city in cities.iterrows():
				city_name = city["city_name"]
				expanded_statement = statement_pattern.format(city_type=city_type, comparative=comparative, city_name=city_name)
				expanded_statement_list.append(expanded_statement)

	return statement_pattern, expanded_statement_list```

